import '../../styles/Main.css';
import React, { useState } from 'react';
import Header from '../MainPage/Header';
import RentalList from './RentalList';

function Rental() {
    const [premises, setPremises] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3001/premise/notrenated');
                setPremises(response.data);
                console.log(response.data);
            } catch (error) {
                console.error('Ошибка загрузки данных:', error);
            }

            try {
                const response = await axios.get('http://localhost:3001/type_premise/all');
                setTypesPremies(response.data);
            } catch (error) {
                console.error('Ошибка загрузки данных:', error);
            }
        };

        // Загрузка данных с сервера при монтировании компонента
        fetchData();
    }, []);

	return (
		<div>
			<div>
				<Header/>
				<RentalList/>
			</div>
		</div>
  	);
}

export default Rental;
